import {React, useRef, useState} from 'react';
import {Outlet,NavLink} from 'react-router-dom'
import PageProfile from '../Images/PageProfile.svg'
import { FaUser, FaSearch } from "react-icons/fa";
function MainPage(){
    const searchBtn = useRef();
    const searchSubmint = () =>{
        console.log(searchBtn.current.value)
    }

    const [isOpen, setIsOpen] = useState(false);

    const toggleNavbar = () => {
        setIsOpen(!isOpen);
    };
    return(
        <div>
            <header className='bg-primary p-2 d-flex align-items-center text-light'>
                <img alt="profile" className='border border-2 rounded-circle' src={PageProfile} style={{width:"100px"}}/>
                <div className='m-2' style={{width:"70%"}}>
                    <h1>Pagina de Prueba</h1>
                    <h3>encabezado de la pagina</h3>
                </div>
                <div className='ms-2 me-2' style={{width:"100%"}}>
                    <nav className="navbar navbar-expand-lg bg-body-tertiary">
                        <div className="container-fluid">
                            <button 
                                className="navbar-toggler" 
                                type="button" 
                                data-bs-toggle="collapse" 
                                data-bs-target="#navbarNavAltMarkup" 
                                aria-controls="navbarNavAltMarkup" 
                                aria-expanded="false" 
                                aria-label="Toggle navigation"
                                onClick={toggleNavbar}
                                >
                                <span className="navbar-toggler-icon"></span>
                            </button>
                            <div className={`collapse navbar-collapse mt-2 ${isOpen ? 'show' : ''}`} id="navbarNavAltMarkup">
                                <form onSubmit={ev=>{
                                    ev.preventDefault();
                                    searchSubmint();
                                }} className='input-group' style={{height:"100%"}}>
                                    <input ref={searchBtn} className='form-control' type='text'/>
                                    <span onClick={
                                        ev=>{
                                            ev.preventDefault();
                                            searchSubmint();
                                        }
                                    } className="input-group-text" role="button" id="basic-addon2"><FaSearch /></span>
                                </form>
                                <div className="navbar-nav align-items-center  bg-primary position-absolute">
                                    <NavLink className="nav-link active" aria-current="page" href="#">Home</NavLink>
                                    <NavLink className="nav-link" href="#">Features</NavLink>
                                    <NavLink className="nav-link" href="#">Pricing</NavLink>
                                    <div role="button" className='d-flex justify-content-end align-items-center text-black '>
                                        <p>Login</p> <FaUser className='mb-3 ms-2' size={15}/>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </nav>
                    {/*<div className='mt-3 d-flex justify-content-around align-items-end' style={{height:"50%"}}>
                        <label className='navbar-toggler border-bottom-0 border-light'>Contenido</label>
                        <label className='btn btn-lg border border-bottom-0 border-light rounded-top'>Quienes Somos</label>
                        <label className='btn btn-lg border border-bottom-0 border-light rounded-top'>Contacto</label>
                    </div>*/}
                </div>

            </header>
            <div>
                <h3>esto es el cuerpo de la pagina</h3>
            </div>
            <div>
                <h3>esto es el pie de la pagina</h3>
            </div>
            <Outlet/>
        </div>
    )
}

export default MainPage;
